public class ModelExplainabilityJobDefinitionFactory(string resourceName = null, Action<Humidifier.SageMaker.ModelExplainabilityJobDefinition> factoryAction = null) : ResourceFactory<Humidifier.SageMaker.ModelExplainabilityJobDefinition>(resourceName)
{

    internal InnerModelExplainabilityJobDefinitionMonitoringOutputConfigFactory ModelExplainabilityJobOutputConfigFactory { get; set; }

    internal InnerModelExplainabilityJobDefinitionStoppingConditionFactory StoppingConditionFactory { get; set; }

    internal InnerModelExplainabilityJobDefinitionModelExplainabilityBaselineConfigFactory ModelExplainabilityBaselineConfigFactory { get; set; }

    internal InnerModelExplainabilityJobDefinitionMonitoringResourcesFactory JobResourcesFactory { get; set; }

    internal InnerModelExplainabilityJobDefinitionNetworkConfigFactory NetworkConfigFactory { get; set; }

    internal InnerModelExplainabilityJobDefinitionModelExplainabilityJobInputFactory ModelExplainabilityJobInputFactory { get; set; }

    internal InnerModelExplainabilityJobDefinitionModelExplainabilityAppSpecificationFactory ModelExplainabilityAppSpecificationFactory { get; set; }

    protected override Humidifier.SageMaker.ModelExplainabilityJobDefinition Create()
    {
        var modelExplainabilityJobDefinitionResult = CreateModelExplainabilityJobDefinition();
        factoryAction?.Invoke(modelExplainabilityJobDefinitionResult);

        return modelExplainabilityJobDefinitionResult;
    }

    private Humidifier.SageMaker.ModelExplainabilityJobDefinition CreateModelExplainabilityJobDefinition()
    {
        var modelExplainabilityJobDefinitionResult = new Humidifier.SageMaker.ModelExplainabilityJobDefinition
        {
            GivenName = InputResourceName,
        };

        return modelExplainabilityJobDefinitionResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.ModelExplainabilityJobDefinition result)
    {
        base.CreateChildren(result);

        result.ModelExplainabilityJobOutputConfig ??= ModelExplainabilityJobOutputConfigFactory?.Build();
        result.StoppingCondition ??= StoppingConditionFactory?.Build();
        result.ModelExplainabilityBaselineConfig ??= ModelExplainabilityBaselineConfigFactory?.Build();
        result.JobResources ??= JobResourcesFactory?.Build();
        result.NetworkConfig ??= NetworkConfigFactory?.Build();
        result.ModelExplainabilityJobInput ??= ModelExplainabilityJobInputFactory?.Build();
        result.ModelExplainabilityAppSpecification ??= ModelExplainabilityAppSpecificationFactory?.Build();
    }

} // End Of Class

